import React from 'react';
import loslagos_1 from './img/loslagos_1.png';
import loslagos_2 from './img/loslagos_2.png';
import { Link } from "react-router-dom";

export default function Home() {

    function over(e) {
        e.currentTarget.src = loslagos_2;
    }

    function out(e) {
        e.currentTarget.src = loslagos_1;
    }   

    return (
        <div className='/'>
            <Link to={"/propiedad/1"} >
            <img
                src={loslagos_1}
                onMouseOver={over}
                onMouseOut={out}
                alt='Regiï¿½n de los Lagos'
                />
                </Link>
        </div>
    );
}
